import React from 'react'
import { Col, Row } from 'react-bootstrap';

 const DateCount = ({data}) => {
  return (
       <Row className="justify-content-center m-">
          <Col sm="8" className='fs-5'>
            The Employee {data.length}
          </Col>
        </Row>
  )
}
export default DateCount;
